 > unpack_swiavms_SLQSAVMSGetSettings_v2to unpack autoreboot.

Hi Alan,

WP76xx uses AVMS service ID 0xFD (avc2) and EM75xx uses service ID 0xF3.

In packingdemo_common.c for oem APIs we have put check 

    if ( GetAvmsVersionSupported() == eQMI_SVC_SWI_M2M_CMD_2 )
    {
        swiavms_loop_avc2();
    }
    else
    {
        swiavms_loop();
    }
So for EM75xx swiavms_loop() will run.

Thanks,
Gurmeet

